insert into Vivienda (id, avatar, codigo_postal, descripcion, direccion, latlng, metros_cuadrados, num_banios, num_habitaciones, poblacion, precio, provincia, tiene_ascensor, tiene_garaje, tiene_piscina, tipo_vivienda, titulo, inmobliaria, propietario) values (NEXTVAL('hibernate_sequence'), 'https://i.pinimg.com/originals/c5/05/3e/c5053ef961cd25837d37a3b15019cf77.png', 41010, 'Casa de 584 m² en Sevilla.Provincia de Sevilla. La amplitud de esta vivienda proporciona a una familia con niños todo el espacio que necesita.', '7354 Menomonie Way', '124.6524669,-9.7780409', 162, 4, 3, 'Triana', 962318, 'Sevilla', false, true, true, 'OBRANUEVA', 'Piso en venta en plaza de la Magdalena', 9, 41);
insert into Vivienda (id, avatar, codigo_postal, descripcion, direccion, latlng, metros_cuadrados, num_banios, num_habitaciones, poblacion, precio, provincia, tiene_ascensor, tiene_garaje, tiene_piscina, tipo_vivienda, titulo, inmobliaria, propietario) values (NEXTVAL('hibernate_sequence'), 'https://i.pinimg.com/originals/c5/05/3e/c5053ef961cd25837d37a3b15019cf77.png', 41010, 'Viviendas de líneas rectas y modernas, muy luminosas, con un diseño exquisito, donde ha primado el espacio, el confort y el bienestar, pensadas para encajar con el entorno que les rodea. Cada vivienda contará con parcela privada que oscilará (según vivienda) entre los 165,75 m2 y los 340,30 m2, con una superficie construida de 106 m2 construidos, distribuidos en 3 dormitorios, baño, aseo (ducha opcional), salón-comedor, cocina independiente, terraza y porche. Entre las calidades destacamos la pre-instalación de aire acondicionado y de alarma y su eficiencia energética.', '8 Summerview Pass', '17.841489,59.3609203', 511, 4, 3, 'Bormujos', 614343, 'Sevilla', false, true, false, 'OBRANUEVA', 'Piso en Bailen', 15, 42);
insert into Vivienda (id, avatar, codigo_postal, descripcion, direccion, latlng, metros_cuadrados, num_banios, num_habitaciones, poblacion, precio, provincia, tiene_ascensor, tiene_garaje, tiene_piscina, tipo_vivienda, titulo, inmobliaria, propietario) values (NEXTVAL('hibernate_sequence'), 'https://i.pinimg.com/originals/12/de/c0/12dec07702f57144f57a6e7ecc98da02.jpg', 41010, 'La casa se compone de sótano, planta principal, primera y segunda planta.En la planta sótano nos encontramos una sala de 25m2, una gran zona de lavadero y un garaje para 3 coches. En la planta principal se sitúa la cocina, que tiene salida directa a la zona de barbacoa, porche y piscina, y un amplio salón comedor con suelos de mármol. La carpintería de la casa es en su gran parte de madera de carácter colonial, a excepción de la cocina y los cuartos de baño que son de aluminio.', '0589 Mallard Place', '100.1233396,-0.6256517', 286, 6, 5, 'Gelves', 78389, 'Sevilla', true, false, false, 'OBRANUEVA', 'Arenal', 7, 43);
